import React from "react";

const DataList = ({ data, index, nomarticle }) => {
  var dataList = [];
  data.map((element) =>
    dataList.push({
      id: element.idarticle,
      value: element.nom_article,
    })
  );

  const button = () => {};

  return (
    <div key={index}>
      <input
        type="text"
        list={dataList}
        onChange={button}
        ref={(element) => {
          nomarticle.current[index] = element;
        }}
      />
      <datalist id="data">
        {dataList.map((item, key) => (
          console.log(item.nom_article)
          // <option key={key} value={item.nom_article} />
        ))}
      </datalist>
    </div>
  );
};

export default DataList;
